import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Test from './Test';

function App() {
  return (
    <div className="App">

      <Router>
        <Switch>
          <Route exact path="/" component={Test} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
